customColumn1.onClick:
{{
(() => {
  const row = Informacion_facturacion.triggeredRow || Informacion_facturacion.selectedRow;
  if (!row) { showAlert("Selecciona un pedido.", "warning"); return; }

  // Guarda TODA la fila para el modal
  storeValue("pedidoSel", row, true);

  // (Opcional) rellena stores que ya usas en tus RPCs
  storeValue("clienteSel",   { id_cliente:   row.id_cliente,   nombre_cliente: row.nombre_cliente }, true);
  storeValue("ubicacionSel", { id_ubicacion: row.id_ubicacion, nombre_ubicacion: row.nombre_ubicacion }, true);
  storeValue("inventarioSel",{ id_bano:      row.id_bano }, true);

  showModal("Modal_Procesar");
})();
}}
